const apiTicketIds = new Set(
  $items("Api Tickets").map(item => String(item.json.TicketID).trim())
);

const closedTickets = $items("Sheet Tickets").filter(item => {
  const sheetTicketId = String(item.json.TicketID).trim();
  return !apiTicketIds.has(sheetTicketId);
});

return closedTickets.map(item => ({
  json: {
    TicketID: item.json.TicketID,
    rowIndex: item.json.row_number
  }
}));
